%[text] %[text:anchor:T_2B6DA392] # **Ternary Chart Examples**
%[text] %[text:anchor:H_7467FA40] **Overview**
%[text] The `TernaryChart` manages a barycentric plot of three variables $A$, $B$ and $C$ that sum to a constant. The chart provides a smooth, interpolated surface for the observed data $Z$. The chart data comprises a table of numeric data containing the three input variables $A$, $B$, $C$ together with the response (output) variable $Z$. For each data point $(A\_i, B\_i, C\_i, Z\_i)$ we have $A\_i + B\_i + C\_i=1$. The chart is equipped with a control panel and contains interactive information on the data composition at each specific point via data tips.
%[text] ![TernaryChart.png](text:image:1519)
%[text] **Documentation**
%[text] - [`patch`](<matlab: doc( "patch" )>): create a surface plot with variable geometric shapes
%[text] - [`line`](<matlab: doc( "line" )>): create a line with variable properties (used for the discrete points) \
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] %[text:anchor:H_AE7E717B] ## Load sample data for the chart.
%[text] This data set comprises three chemicals (methanol, acetone and chloroform) together with the bubble point of the ternary mixture at a fixed pressure.
load( fullfile( chartsRoot(), "data", "Chemicals.mat" ) )
disp( T ) %[output:5fea8bbe]
%%
%[text] %[text:anchor:H_AC0C4515] ## Create a figure for the chart.
f = exampleFigure( "Name", "TernaryChart Example" ); %[output:47ebc86f]
%%
%[text] %[text:anchor:H_FB414886] ## Create the chart.
TC = TernaryChart( "Parent", f, ... %[output:group:02c8971d] %[output:47ebc86f]
    "Data", T ); %[output:group:02c8971d] %[output:47ebc86f]
%%
%[text] %[text:anchor:H_2A7FC7B3] ## Annotate the chart.
xlabel( TC, "Methanol", "FontSize", 12 ) %[output:532b6284]
ylabel( TC, "left", "Acetone", "FontSize", 12 ) %[output:532b6284]
ylabel( TC, "right", "Chloroform", "FontSize", 12 ) %[output:532b6284]
zlabel( TC, ... %[output:532b6284]
    "Ternary mixture bubble point at 101.325 kPa (" + char( 176 ) + "C)", ... %[output:532b6284]
    "FontSize", 12, "FontWeight", "bold" ) %[output:532b6284]
colormap( TC, cool() ) %[output:532b6284]
colorbar( TC ) %[output:532b6284]
%%
%[text] %[text:anchor:H_142F42D6] ## Customize the chart's appearance.
%[text] First, adjust the marker size of the discrete data points.
TC.MarkerSize = 20; %[output:75cdc658]
%[text] Modify the transparency of the surface.
TC.FaceAlpha = 0.75; %[output:75cdc658]
%[text] By default, when the `SurfaceType` is `"surface"`, the `EdgeColor` is `[0, 0, 0]`.
TC.EdgeColor = "flat"; %[output:75cdc658]
%%
%[text] %[text:anchor:H_BC221C65] ## Modify the chart's surface type.
%[text] The ternary chart supports both the surface and mesh types.
TC.SurfaceType = "mesh"; %[output:668074d7]
TC.LineWidth = 3; %[output:668074d7]
%%
%[text] %[text:anchor:H_8C459A94] ## Modify the chart's grid and ticks.
%[text] We can set a new value for the `GridResolution` property.
TC.GridResolution = 20; %[output:3e794d9a]
%[text] The `TickRate` property controls the number of axes ticks.
TC.TickRate = 2; %[output:3e794d9a]
%%
%[text] %[text:anchor:H_27DF88B0] ## Adjust the chart's view.
%[text] The ternary chart has the view method for adjusting the camera angle. This method has the same syntax as the usual axes [view](<matlab: doc( "view" )>) function.
view( TC, [-2, 55] ) %[output:27b99e54]
set( TC, "GridResolution", 5, "TickRate", 1 ) %[output:27b99e54]
%%
%[text] %[text:anchor:H_EE0F22D0] ## Rotate the chart.
%[text] We can use the `rotate` method to rotate the chart clockwise or counter-clockwise by 120 degrees.
TC.rotate( "clockwise" ) %[output:9da8f5c6]
%%
%[text] %[text:anchor:H_AE442B4F] ## Enable the chart's control panel.
TC.Controls = "on"; %[output:3c2b5a57]
colorbar( TC, "off" ) %[output:3c2b5a57]
%%
